import * as React from 'react'
import { Text, StyleSheet, View, Pressable, Image } from 'react-native'
import { useNavigation } from '@react-navigation/native'
import { Color, FontFamily, Padding, FontSize, Border } from '../GlobalStyles'

const MenuInferior = () => {
  const navigation = useNavigation()

  return (
    <View style={styles.menInferior}>
      <View style={[styles.groupContainer, styles.frameParentFlexBox]}>
        <Pressable
          style={styles.container}
          onPress={() => navigation.navigate('UltimasConsultas')}
        >
          <Image
            style={styles.iconLayout}
            contentFit="cover"
            source={require('../assets/group-1171276700.png')}
          />
        </Pressable>
        <Pressable
          style={[styles.vector, styles.frameLayout]}
          onPress={() => navigation.navigate('Favoritos1')}
        >
          <Image
            style={styles.iconLayout}
            contentFit="cover"
            source={require('../assets/vector.png')}
          />
        </Pressable>
        <Image
          style={styles.capturaDePantalla20231124}
          contentFit="cover"
          source={require('../assets/captura-de-pantalla-20231124-114115-1.png')}
        />
        <Pressable
          style={[styles.frame, styles.frameLayout]}
          onPress={() => navigation.navigate('HistorialDePruebas')}
        >
          <Image
            style={styles.iconLayout}
            contentFit="cover"
            source={require('../assets/frame-1547756022.png')}
          />
        </Pressable>
        <Pressable
          style={[styles.groupPressable, styles.frameLayout]}
          onPress={() => navigation.navigate('TuPerfil')}
        >
          <Image
            style={styles.iconLayout}
            contentFit="cover"
            source={require('../assets/group-1171276701.png')}
          />
        </Pressable>
      </View>
      <Image
        style={styles.menInferiorChild}
        contentFit="cover"
        source={require('../assets/ellipse-7194.png')}
      />
    </View>
  )
}

export default MenuInferior

const styles = StyleSheet.create({
  container: {
    width: 22,
    height: 25
  },
  iconLayout: {
    height: '100%',
    width: '100%'
  },
  vector: {
    width: 23
    // marginLeft: 47
  },
  menInferiorChild: {
    // left: 165,
    width: 37,
    height: 24
    // top: 0,
    // position: 'absolute'
  },
  capturaDePantalla20231124: {
    width: 33,
    height: 33
    // marginLeft: 47
  },
  menInferior: {
    // top: 725,
    height: 75,
    width: 360
    // left: 0,
    // position: 'absolute'
  },
  groupContainer: {
    // top: 10,
    backgroundColor: Color.gris,
    height: 65,
    // paddingVertical: Padding.p_3xs,
    flexDirection: 'row'
  },
  frameParentFlexBox: {
    // paddingHorizontal: Padding.p_xl,
    justifyContent: 'center',
    alignItems: 'center',
    width: 360
    // left: 0,
    // position: 'absolute'
  },
  frameLayout: {
    height: 20
    // marginLeft: 47
  },
  frame: {
    width: 20,
    marginLeft: 47
  },
  groupPressable: {
    width: 19,
    marginLeft: 47
  }
})
